import React from 'react'

const RendelesItem = (props) => {
    const {id,termekNev,ar,termekKep} = props.data;
  
    return (
    <div className='renelesItem'>
       
       <img src={termekKep}/>
       <div className='description'>
        <p>
            {" "}
            <b>{termekNev}</b>
        </p>
        <p>{ar}</p>
       </div>
    </div>
  )
}

export default RendelesItem;
